import "../styles/BrewCard.css";

// data-types: brewery_type, city, country, id, name, phone, latitude, longitude, postal_code, state, street, website_url

const BrewCard = ({ beer }) => {
  let address =
    beer.street + " " + beer.city + ", " + beer.state + " " + beer.postal_code;

  let long = beer.longitude;
  let lat = beer.latitude;

  return (
    <div className={`brewcard-container`}>
      {<h1 className={`brew-name brew-item`}>{beer.name}</h1>}
      {<h3 className={`brew-item`}>Type: {beer.brewery_type}</h3>}
      {<h3 className={`brew-item`}>Address: {address}</h3>}
      {<h3 className={`brew-item`}>Website: {beer.website_url}</h3>}
    </div>
  );
};

export default BrewCard;
